import React from 'react'
import { useNavigate } from 'react-router-dom';


export default function AddUser(isLoggedIn){

    const navigate = useNavigate();

    useEffect(() => {
        if (!isLoggedIn) {
          navigate('/login');
        } 
      }, [isLoggedIn]);



    return (

        <h1>Welcome</h1>
    )
}
